import React from "react";

const Home = () => {
  return (
    <div>
      <h1>Bine ai venit pe pagina principală!</h1>
      <div className="container">
        <div className="box">
          <h2>Chenarul 1</h2>
          <p>Conținut chenar 1...</p>
        </div>
        <div className="box">
          <h2>Chenarul 2</h2>
          <p>Conținut chenar 2...</p>
        </div>
        <div className="box">
          <h2>Chenarul 3</h2>
          <p>Conținut chenar 3...</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
